Here's a Python program that prints out the first 100 prime numbers:

```python
def is_prime(num):
    if num <= 1:
        return False
    for i in range(2, int(num**0.5) + 1):
        if num % i == 0:
            return False
    return True

def find_primes(count):
    prime_numbers = []
    num = 2
    while len(prime_numbers) < count:
        if is_prime(num):
            prime_numbers.append(num)
        num += 1
    return prime_numbers

if __name__ == "__main__":
    prime_count = 100
    primes = find_primes(prime_count)
    print("The first", prime_count, "prime numbers are:")
    for num in primes:
        print(num)
```

This program defines two functions: `is_prime()` checks if a number is prime, and `find_primes()` finds the first `count` prime numbers. The main part of the code calls these functions to find and print the first 100 prime numbers.
